def boxcar_matched_filter(signal, boxcar_length):
    if not signal or not isinstance(signal, list) or not all(isinstance(x, (int, float)) for x in signal):
        return None

    if not isinstance(boxcar_length, int) or boxcar_length < 1:
        return None

    if len(signal) < boxcar_length:
        return None

    result = []
    for i in range(len(signal) - boxcar_length + 1):
        sum_val = sum(signal[i:i+boxcar_length])
        result.append(sum_val)

    return result

